import React from "react";

const Header = () => {
    return (
        <header className="header">
            <div className="meniu-juosta">
                    <span>Makėtai</span>
                    <button>Detalės</button>
                </div>
            <img src="/nuotraukos/logo.png" alt="Paveikslėlis" />
            <h1>Sveiki atvykę į mano pasaulį!</h1>
            <p>Esu grafinės dizainerė ir iliustratorė.</p>
        </header>
    );
};

export default Header;
